import React, { Component } from 'react';
import SelectPoblacio from '../Components/SelectEspecialitats';
import SelectEspecialitats from "../Components/SelectPoblacio";
import Cards from "../Components/Cards"

class Home extends React.Component {

  sercadorNom = React.createRef();

  constructor(props){
    super(props);

    this.state = {
      nom : React.createRef(),
      poblacio:"",
      especialitat:""
    }
  
  }
  obtenirValors = (e) =>{
    e.pre
  }
  
    render() {

        return (
          <div className="app conteiner " id="contenidorPrincipal">
            <div className="container">
              <form id="formInici" onSubmit={this.obtenirValors}>
                <div className="form-row justify-content-center">
                  <div className="form-group col-md-4">
                    <label>Nom restaurant</label>
                    <input ref={this.sercadorNom} type="text" className="form-control" />
                  </div>
                  <SelectPoblacio />
                  <SelectEspecialitats />
                  <div className="form-group col-md-4">
                    <input type="submit" className="btn btn-danger" value="Cerca"/>
                  </div>
                </div>
              </form>
            </div>
            <div className="container">
              <Cards />
            </div>
          </div>
    
        );
      }
}
export default Home;
